import MyplantsTab from "./MyPlantsTab";
import styled from "styled-components";
import Button from 'react-bootstrap/Button';
import "./Myplants.css";
import myplants5 from "../img/myplants5.jpg";


function Myplants() {


    return (
        <>
        <MyplantsTab />




        <div className= "container"> 
          <img src = {myplants5} />
          <Button id="myplantsbtn" variant="outline-secondary" href="/myplantswrite">등록하기</Button>

        </div>

        </>
    )
}

export default Myplants;
